A WebResource that is an angular "application".  When resource is requested, the pieces are pulled together into a full html document and served to the client.
 @property {sourcecode} body HTML body for the app
 @property {function} config_function Function passed to angular.config to initialize the app.
 @property {sourcecode} head HTML head for the app
 @property {reference.<AngularModule>} module Angular module to which the application belongs
 @property {reference.<CssResource>[]} css_dependencies List of CssResources to be served with the app
 @property {reference.<JsResource>[]} js_dependencies List of JsResources to be served with the app
